import jwt from 'jsonwebtoken'
import { jwtSecret, jwtFixed } from '../../config'
import { auth as ServiceAuth } from '../../services'
import { isInvalid, malformedToken, authenticationFailure, invalidLogin } from '../../config'


// Token validation.
const validateToken = req => {

  const { authorization } = req.headers
  const lang = req.lang

  if (!authorization || authorization === undefined) {
    throw authenticationFailure
  }
  const parts = authorization.split(' ')
  const scheme = parts[0]
  const token = parts[1]

  if (!parts.length === 2) throw isInvalid
  if (!token) throw malformedToken
  if (!/^Bearer$/i.test(scheme)) throw isInvalid

  // Checks the token.
  return jwt.verify(token, jwtSecret, async (err, decoded) => {

    // Error return messages.
    const message = err ? err.message : ''    
    if (message === 'invalid signature') throw isInvalid
    if (message === 'jwt expired') throw expired
    if (message === 'invalid token') throw isInvalid    

    // Treats any other error as invalid.
    if (err) {
      throw isInvalid  
    }

    try {

      const { id, email } = decoded.data

      const { token } = await ServiceAuth.getToken({id, email})

      if (!token) throw invalidLogin

      return decoded.data
    } catch (err) {
      throw err
    }
  })
}

const sign = ({_id: id, email, name, lastName}) => (
  jwt.sign({
    data: {id, email, name, lastName}
  }, jwtSecret, {
    expiresIn: '7d'
  })
)

export {
  validateToken,
  sign
}

