import { auth as ServiceAuth } from '../../../services'
import { jwt } from '../../../libs'
import bcrypt from 'bcrypt';
import { invalidLogin, userBlock, successLogin } from '../../../config'

export default {
  async auth (req, res, next) {
    try {

      const dataBody = {
        email: req.body.email.toLowerCase(),
        password: req.body.password
      }

      const user = await ServiceAuth.auth(dataBody)

      if (user === null || !user) {
        res.status(401).json({error: true, msg: invalidLogin, data: null})
        return false
      }

      // Decrypts password and compares with password.
      const { password: passwordText } = dataBody;
      const { password: passwordHash } = user.information
      let encryptPassword = await bcrypt.compare(passwordText, passwordHash);

      // Validates if password is not valid returns error.
      if (!encryptPassword){
        res.status(401).json({error: true, msg: userBlock, data: null})
        return false
      }

      const { _id, information: { email, name, lastName } } = user
