import Promise from 'bluebird'
import Schema from '../../schemas/user'

const { User } = Schema;

export default {

  auth (payload) {
    return new Promise(async (resolve, reject) => {

      try{
        const { email } = payload
        const retAuth = await User.findOne({'information.email': email});
        resolve(retAuth)

      } catch(err) {
        reject(err)
      }
    })
  },

  updateToken (payload) {
    return new Promise(async (resolve, reject) => {
      User.updateOne({_id: payload._id}, { $set: {token: payload.token}}, (err, items) => {
        if (err) {
          reject(err)
          return
        }

        if (items.nModified) {
          resolve(items.ok)
        } else {
          reject('Fail to update token')
        }
      })      
    })
  },

  getToken (payload) {

    return new Promise(async (resolve, reject) => {
      const { id, email } = payload
      User.findOne({ _id: id, 'information.email': email }, (err, items) => {

        if (err) {
          reject(err)
          return
        }
        resolve(items)
      })      
    })
  }
}

