import { redis as db } from '../../../libs'
import Promise from 'bluebird'

export default { 

  selectData  (key) {
    return new Promise(async (resolve, reject) => {
      let obj = await db.getAsync(key)
      resolve(JSON.parse(obj))
    })
  },

  deleteKeys () {
    return new Promise(async (resolve, reject) => {
      let obj = await db.flushallAsync()
      resolve(obj)
    })
  },

